System Requirements with Pro Tools 9.0-9.0.3 Software

For optimal performance and reliability, be sure that your computer or laptop meets the following minimum system requirements.

Important: Avid dedicates a significant amount of engineering resources and time to test and qualify specific platform configurations. While such systems may operate without problems, please understand we cannot provide support should you choose to use a non-qualified system. 

Mac Systems
Computer: Avid-qualified Apple computer (see details)
System Software: Snow Leopard: Mac OS X 10.6.2, 10.6.3, 10.6.4, 10.6.5, 10.6.6, 10.6.7, or 10.6.8 (32 or 64-bit)
Mac OS X 10.6.8 and the supplemental update &quot;10.6.8v1.1&quot; is officially qualified with Pro Tools 9.0.3 and 9.0.5
Pro Tools 9.0 and 9.0.1 not tested with 10.6.7 and higher
OS X Lion: Pro Tools 9.0.5 adds public beta support for Mac OS X 10.7.x (Lion) (see details)
All versions of Pro Tools software before Pro Tools 9.0.5 are not compatible and will not work with OS X Lion
Total System RAM: 2GB minimum, 4GB or more recommended.
